import React from 'react';
import Head from 'next/head';

const Layout = ({ children, styleTags}) => {
  return (
    <>
      <Head>
        {styleTags.map((styleTag) => styleTag)}
      </Head>
      {children}
    </>
  )
};

export default Layout;
